ransient_acf_pro_get_remote_info','a:15:{s:4:\"name\";s:26:\"Advanced Custom Fields Pro\";s:4:\"slug\";s:26:\"advanced-custom-fields-pro\";s:8:\"homepage\";s:36:\"http://www.advancedcustomfields.com/\";s:7:\"version\";s:5:\"5.3.4\";s:6:\"author\";s:13:\"elliot condon\";s:10:\"author_url\";s:28:\"http://www.elliotcondon.com/\";s:12:\"contributors\";s:12:\"elliotcondon\";s:8:\"requires\";s:5:\"3.6.0\";s:6:\"tested\";s:5:\"4.4.0\";s:4:\"tags\";a:34:{i:0;s:5:\"5.3.3\";i:1;s:5:\"5.3.2\";i:2;s:5:\"5.3.1\";i:3;s:5:\"5.3.0\";i:4;s:5:\"5.2.9\";i:5;s:5:\"5.2.8\";i:6;s:5:\"5.2.7\";i:7;s:5:\"5.2.6\";i:8;s:5:\"5.2.5\";i:9;s:5:\"5.2.4\";i:10;s:5:\"5.2.3\";i:11;s:5:\"5.2.2\";i:12;s:5:\"5.2.1\";i:13;s:5:\"5.2.0\";i:14;s:5:\"5.1.9\";i:15;s:5:\"5.1.8\";i:16;s:5:\"5.1.7\";i:17;s:5:\"5.1.6\";i:18;s:5:\"5.1.5\";i:19;s:5:\"5.1.4\";i:20;s:5:\"5.1.3\";i:21;s:5:\"5.1.2\";i:22;s:5:\"5.1.1\";i:23;s:5:\"5.1.0\";i:24;s:5:\"5.0.9\";i:25;s:5:\"5.0.8\";i:26;s:5:\"5.0.7\";i:27;s:5:\"5.0.6\";i:28;s:5:\"5.0.5\";i:29;s:5:\"5.0.4\";i:30;s:5:\"5.0.3\";i:31;s:5:\"5.0.2\";i:32;s:5:\"5.0.1\";i:33;s:5:\"5.0.0\";}s:6:\"tagged\";s:123:\"acf, advanced, custom, field, fields, custom field, custom fields, simple fields, magic fields, more fields, repeater, edit\";s:11:\"description\";s:4328:\"<p>Advanced Custom Fields is the perfect solution for any WordPress website which needs more flexible data like other Content Management Systems. </p>\n<ul><li>Visually create your Fields</li><li>Select from multiple input types (text, textarea, wysiwyg, image, file, page link, post object, relationship, select, checkbox, radio buttons, date picker, true / false, repeater, flexible content, gallery and more to come!)</li><li>Assign your fields to multiple edit pages (via custom location rules)</li><li>Easily load data through a simple and friendly API</li><li>Uses the native WordPress custom post type for ease of use and fast processing</li><li>Uses the native WordPress metadata for ease of use and fast processing</li></ul>\n<h4> Field Types </h4>\n<ul><li>Text (type text, api returns text)</li><li>Text Area (type text, api returns text)</li><li>Number (type number, api returns integer)</li><li>Email (type email, api returns text)</li><li>Password (type password, api returns text)</li><li>WYSIWYG (a WordPress wysiwyg editor, api returns html)</li><li>Image (upload an image, api returns the url)</li><li>File (upload a file, api returns the url)</li><li>Select (drop down list of choices, api returns chosen item)</li><li>Checkbox (tickbox list of choices, api returns array of choices)</li><li>Radio Buttons ( radio button list of choices, api returns chosen item)</li><li>True / False (tick box with message, api returns true or false)</li><li>Page Link (select 1 or more page, post or custom post types, api returns the selected url)</li><li>Post Object (select 1 or more page, post or custom post types, api returns the selected post objects)</li><li>Relationship (search, select and order post objects with a tidy interface, api returns the selected post objects)</li><li>Taxonomy (select taxonomy terms with options to load, display and save, api returns the selected term objects)</li><li>User (select 1 or more WP users, api returns the selected user objects)</li><li>Google Maps (interactive map, api returns lat,lng,address data)</li><li>Date Picker (jquery date picker, options for format, api returns string)</li><li>Color Picker (WP color swatch picker)</li><li>Tab (Group fields into tabs)</li><li>Message (Render custom messages into the fields)</li><li>Repeater (ability to create repeatable blocks of fields!)</li><li>Flexible Content (ability to create flexible blocks of fields!)</li><li>Gallery (Add, edit and order multiple images in 1 simple field)</li><li>[Custom](<a href=\"http://www.advancedcustomfields.com/resources/tutorials/creating-a-new-field-type/)\">www.advancedcustomfields.com/resources/tutorials/creating-a-new-field-type/)</a> (Create your own field type!)</li></ul>\n<h4> Tested on </h4>\n<ul><li>Mac Firefox 	:)</li><li>Mac Safari 	:)</li><li>Mac Chrome	:)</li><li>PC Safari 	:)</li><li>PC Chrome		:)</li><li>PC Firefox	:)</li><li>iPhone Safari :)</li><li>iPad Safari 	:)</li><li>PC ie7		:S</li></ul>\n<h4> Website </h4>\n<p><a href=\"http://www.advancedcustomfields.com/\">www.advancedcustomfields.com/</a></p>\n<h4> Documentation </h4>\n<ul><li>[Getting Started](<a href=\"http://www.advancedcustomfields.com/resources/#getting-started)\">www.advancedcustomfields.com/resources/#getting-started)</a></li><li>[Field Types](<a href=\"http://www.advancedcustomfields.com/resources/#field-types)\">www.advancedcustomfields.com/resources/#field-types)</a></li><li>[Functions](<a href=\"http://www.advancedcustomfields.com/resources/#functions)\">www.advancedcustomfields.com/resources/#functions)</a></li><li>[Actions](<a href=\"http://www.advancedcustomfields.com/resources/#actions)\">www.advancedcustomfields.com/resources/#actions)</a></li><li>[Filters](<a href=\"http://www.advancedcustomfields.com/resources/#filters)\">www.advancedcustomfields.com/resources/#filters)</a></li><li>[How to guides](<a href=\"http://www.advancedcustomfields.com/resources/#how-to)\">www.advancedcustomfields.com/resources/#how-to)</a></li><li>[Tutorials](<a href=\"http://www.advancedcustomfields.com/resources/#tutorials)\">www.advancedcustomfields.com/resources/#tutorials)</a></li></ul>\n<h4> Bug Submission and Forum Support </h4>\n<p><a href=\"http://support.advancedcustomfields.com/\">support.advancedcustomfields.com/</a></p>\n<h4> Please Vote and Enjoy </h4>\n<p>Your votes really make a difference! Thanks.</p>\n\";s:12:\"installation\";s:467:\"<ol><li>Upload <code>advanced-custom-fields</code> to the <code>/wp-content/plugins/</code> directory</li><li>Activate the plugin through the <code>Plugins</code> menu in WordPress</li><li>Click on the new menu item \"Custom Fields\" and create your first Custom Field Group!</li><li>Your custom field group will now appear on the page / post / template you specified in the field group\'s location rules!</li><li>Read the documentation to display your data: </li></ol>\n\";s:9:\"changelog\";s:6820:\"<h4> 5.3.4 </h4>\n<ul><li>User field: Added pagination for Select2 results</li><li>Tab field: Fixed issue where no tab was active within a widget</li><li>Taxonomy field: Fixed issue where term order was lost when using <code>load_terms</code> setting</li><li>Image field: Alt tag will now update when editing/changing selected image</li><li>Field group: Removed Comic sans <code>Drag/drop</code> text (OMG)</li><li>Core: Changed button classes from <code>.acf-button</code> to <code>.button</code></li><li>Core: Fixed double `__()` issue when exporting field group with new l10n settings</li><li>Core: Removed some <code>wp_cache_delete()</code> functions to improve load speed on heavily cached websites</li><li>Core: Removed `esc_html()` from field label and added new filter <code>acf/get_field_label</code></li><li>Core: Minor fixes and improvements</li><li>API: Added new <code>honeypot</code> setting to the `acf_form()` function</li><li>Language: Added Bulgarian translation - thanks to Marin Atanasov</li><li>Language: Added Swiss German translation - thanks to Raphael Hüni</li><li>Language: Added Indonesian translation - thanks to Rio Bermano</li></ul>\n<h4> 5.3.3.2 </h4>\n<ul><li>Core: Fixed bug preventing new translation settings <code>l10n_field</code> and <code>l10n_field_group</code></li><li>Core: Fixed bug preventing plugin updates when included within theme</li><li>Core: Added `esc_html()` to field label</li></ul>\n<h4> 5.3.3.1 </h4>\n<ul><li>Tab field: Fixed bug causing issues with conditional logic</li><li>WYSIWYG field: Fixed PHP error on front end form</li></ul>\n<h4> 5.3.3 </h4>\n<ul><li>Google Maps field: Fixed bug where pasting value did not trigger auto complete</li><li>Select field: Improved Select2 search matching for special characters</li><li>Select field: Improved asset loading to allow other Select2 libraries to load first</li><li>Select field: Added compatibility for both Select2 v3 and v4</li><li>WYSIWYG field: Added new responsive images filter to the <code>acf_the_content</code> filter</li><li>oEmbed field: Added compatibility for custom oEmbed handlers</li><li>Flexible Content field: Fixed bug causing sub fields to move when duplicating layouts</li><li>Core: Added new translation settings <code>l10n</code>, <code>l10n_textdomain</code>, <code>l10n_field</code> and <code>l10n_field_group</code></li><li>Core: Improved Export to PHP feature which now uses the above translation settings</li><li>Core: Fixed PHP error preventing new field groups from loading when editing a post</li><li>Core: Added hierarchy to taxonomy terms shown in drop down elements</li><li>Core: Improved update logic to ignore plugin when included within a theme / plugin</li><li>API: Improved `acf_form()` loading efficiency when using <code>new_post</code> setting</li><li>API: Improved `add_row()` function to work when no value exists</li><li>API: Added new function `get_row_index()` to use within the `have_rows()` loop</li><li>Language: Updated Polish translation - thanks to Michal Lepiarz</li><li>Language: Updated Persian translation - thanks to Kamel</li><li>Language: Updated Spanish translation - thanks to Federico Schäfer</li><li>Language: Updated Norwegian translation - thanks to Havard Grimelid</li><li>Language: Updated Swedish translation - thanks to Björn Göransson</li></ul>\n<h4> 5.3.2.2 </h4>\n<ul><li>Core: Fixed PHP error when registering a local field missing one of more settings</li><li>Core: Fixed incorrect json load_path setting when WPML is active</li><li>Language: Updated Polish translation - thanks to Michal Lepiarz</li></ul>\n<h4> 5.3.2.1 </h4>\n<ul><li>Core: Fixed bug causing issues when loading values from an options page, widget or taxonomy term</li></ul>\n<h4> 5.3.2 </h4>\n<ul><li>Repeater field: Added new setting and icon to collapse row</li><li>Google Maps: Improved google API loading for better theme compatibility</li><li>Taxonomy field: Fixed bug where <code>Add new term</code> popup only showed 20 parent terms</li><li>Core: Added new setting <code>export_translate</code> to customise which field settings should be wrapped in __()</li><li>Core: Improved efficiency of AJAX call when finding new field groups when editing a post</li><li>API: Added new functions add_row(), update_row() and delete_row()</li><li>Language: Updated German translation - thanks to Ralf Koller</li><li>Language: Updated Italian translation - thanks to Davide Pantè</li><li>Language: Updated Dutch translation - thanks to Derk Oosterveld</li><li>Language: Updated Portuguese translation - thanks to Augusto Simão</li></ul>\n<h4> 5.3.1 </h4>\n<ul><li>Flexible Content field: added toggle icons to show layout open/close state</li><li>Gallery field: Fixed bug where images could not save a blank title value</li><li>Taxonomy field: Added pagination when rendered as a Select2 element</li><li>Relationship field: Changed validation to better edit values when a minimum is set</li><li>Google map field: Fixed minor autocomplete bugs and added search icon</li><li>Message field: Added new_lines setting</li><li>Core: Added <code>*</code> to required fields when editing a field group</li><li>Core: Prevented updates to .json file when syncing</li><li>Core: Fields now render as div (instead of table) when labels are left aligned</li><li>Core: Minor fixes and improvements</li><li>Language: Updated .po headers - thanks to Ralf Koller</li></ul>\n<h4> 5.3.0 </h4>\n<ul><li>WYSIWYG field: Fixed <code>Visual/Text</code> toggle bug with WP 4.3</li><li>Select field: Fixed Select2 bug hiding selected choices</li></ul>\n<h4> 5.2.9 </h4>\n<ul><li>Field group: Added new <code>status</code> setting to enable/disable</li><li>Field group: Added new <code>description</code> setting shown to developers when viewing the field group list</li><li>Field group: Moved <code>Show field keys</code> Screen Option within existing <code>Show on Screen</code> checkboxes</li><li>Tab field: Fixed missing min-height to left aligned tab wrapper</li><li>Relationship field: Added timeout to reduce AJAX requests whilst typing in search</li><li>Flexible Content field: Fixed minor JS bug where removing a layout would not update the order numbers</li><li>Core: Fixed bug validating uppercase file extensions</li><li>Core: Renamed menu items</li><li>Core: Replace sprite icons with font</li><li>Core: Added new setting <code>export_textdomain</code> to add __() to generated export code</li><li>Core: Fixed conflict with Post Type Order plugin causing issues when querying posts</li><li>Core: Fixed conflict with WPML causing issues when querying posts</li><li>Core: Added compatibility for WP 4.3</li><li>Core: Minor fixes and improvements</li><li>Language: Updated German translation - thanks to Ralf Koller</li><li>Language: Updated Italian translation - thanks to Davide Pantè</li></ul>\n\";s:14:\"upgrade_notice\";s:550:\"<h4> 5.2.7 </h4>\n<ul><li>Field class names have changed slightly in v5.2.7 from `field_type-{$type}` to `acf-field-{$type}`. This change was introduced to better optimise JS performance. The previous class names can be added back in with the following filter: <a href=\"http://www.advancedcustomfields.com/resources/acfcompatibility/\">www.advancedcustomfields.com/resources/acfcompatibility/</a></li></ul>\n<h4> 3.0.0 </h4>\n<ul><li>Editor is broken in WordPress 3.3</li></ul>\n<h4> 2.1.4 </h4>\n<ul><li>Adds post_id column back into acf_values</li></ul>\n\";}','no'),(1341,'_site_transient_timeout_theme_roots','1456479290','yes'),(1342,'_site_transient_theme_roots','a:1:{s:13:\"crowsfootball\";s:7:\"/themes\";}','yes');
