 cold (and probably wet!). Photography and filming is actively encouraged!'),(8655,610,'_spectators','field_5643b839945e6'),(8656,610,'roster','a:9:{i:0;s:3:\"240\";i:1;s:3:\"234\";i:2;s:3:\"243\";i:3;s:3:\"231\";i:4;s:3:\"172\";i:5;s:3:\"177\";i:6;s:3:\"219\";i:7;s:3:\"326\";i:8;s:3:\"223\";}'),(8657,610,'_roster','field_5644ac748ebbd'),(8658,610,'location_0_venue_name','Manchester College, Nicholls Campus'),(8659,610,'_location_0_venue_name','field_5643a5a5a2147'),(8660,610,'location_0_venue_address','Hyde Rd, Manchester'),(8661,610,'_location_0_venue_address','field_5643a5b8a2148'),(8662,610,'location_0_venue_postcode','M12 6BA'),(8663,610,'_location_0_venue_postcode','field_5643a5d8a2149'),(8664,610,'location_0_venue_lat','53.4695386'),(8665,610,'_location_0_venue_lat','field_5643a612a214a'),(8666,610,'location_0_venue_lng','-2.2174348'),(8667,610,'_location_0_venue_lng','field_5643a672a214b'),(8668,610,'location_0_public_transport_links_0_name','New Islington'),(8669,610,'_location_0_public_transport_links_0_name','field_5643a822a214d'),(8670,610,'location_0_public_transport_links_0_lat','53.4695574'),(8671,610,'_location_0_public_transport_links_0_lat','field_5643a9e572f63'),(8672,610,'location_0_public_transport_links_0_lng','-2.2261896'),(8673,610,'_location_0_public_transport_links_0_lng','field_5643a9e572f64'),(8674,610,'location_0_public_transport_links_1_name','Ardwick Train Station'),(8675,610,'_location_0_public_transport_links_1_name','field_5643a8fda2151'),(8676,610,'location_0_public_transport_links_1_lat','53.4715732'),(8677,610,'_location_0_public_transport_links_1_lat','field_5643a8fda2152'),(8678,610,'location_0_public_transport_links_1_lng','-2.2165087'),(8679,610,'_location_0_public_transport_links_1_lng','field_5643a8fda2153'),(8680,610,'location_0_public_transport_links','a:2:{i:0;s:4:\"tram\";i:1;s:5:\"train\";}'),(8681,610,'_location_0_public_transport_links','field_5643a7dca214c'),(8682,610,'location','a:1:{i:0;s:5:\"venue\";}'),(8683,610