tions','field_56a3dee5efebe'),(10294,628,'spectators','Spectators are always welcome! Be sure to wear your Crows colours, or even better, Crows merchandise if you have it. There\'s no seating at the venue, so it might be an idea to bring something to sit on ( a camping chair is perfect). Why not make a day of it, bring a picnic and a flask of tea (or something stronger!), but be sure to wrap up warm, bring waterproofs and an umbrella as it\'s Manchester in February, it\'ll be cold (and probably wet!). Photography and filming is actively encouraged!'),(10295,628,'_spectators','field_5643b839945e6'),(10296,628,'roster','a:9:{i:0;s:3:\"240\";i:1;s:3:\"234\";i:2;s:3:\"243\";i:3;s:3:\"231\";i:4;s:3:\"172\";i:5;s:3:\"177\";i:6;s:3:\"219\";i:7;s:3:\"326\";i:8;s:3:\"223\";}'),(10297,628,'_roster','field_5644ac748ebbd'),(10298,628,'location_0_venue_name','Manchester College, Nicholls Campus'),(10299,628,'_location_0_venue_name','field_5643a5a5a2147'),(10300,628,'location_0_venue_address','Hyde Rd, Manchester'),(10301,628,'_location_0_venue_address','field_5643a5b8a2148'),(10302,628,'location_0_venue_postcode','M12 6BA'),(10303,628,'_location_0_venue_postcode','field_5643a5d8a2149'),(10304,628,'location_0_venue_lat','53.4695386'),(10305,628,'_location_0_venue_lat','field_5643a612a214a'),(10306,628,'location_0_venue_lng','-2.2174348'),(10307,628,'_location_0_venue_lng','field_5643a672a214b'),(10308,628,'location_0_public_transport_links_0_name','New Islington'),(10309,628,'_location_0_public_transport_links_0_name','field_5643a822a214d'),(10310,628,'location_0_public_transport_links_0_lat','53.4695574'),(10311,628,'_location_0_public_transport_links_0_lat','field_5643a9e572f63'),(10312,628,'location_0_public_transport_links_0_lng','-2.2261896'),(10313,628,'_location_0_public_transport_links_0_lng','field_5643a9e572f64'),(10314,628,'location_0_public_transport_links_1_name','Ardwick'),(10315,628,'_location_0_public_transport_links_1_name','field_5643a8fda2151'),(10316,628,'loca