-16 13:57:32','','Ronan gets tackled by small child','','inherit','closed','closed','','432-revision-v1','','','2015-11-16 13:57:32','2015-11-16 13:57:32','',432,'http://local.wordpress.dev/432-revision-v1/',0,'revision','',0),(435,3,'2015-11-16 14:05:39','2015-11-16 14:05:39','','Ronan gets tackled by small child','','inherit','closed','closed','','432-revision-v1','','','2015-11-16 14:05:39','2015-11-16 14:05:39','',432,'http://local.wordpress.dev/432-revision-v1/',0,'revision','',0),(436,3,'2015-11-16 14:14:33','2015-11-16 14:14:33','','Ronan tackled by small child','','inherit','closed','closed','','432-revision-v1','','','2015-11-16 14:14:33','2015-11-16 14:14:33','',432,'http://local.wordpress.dev/432-revision-v1/',0,'revision','',0),(437,3,'2015-11-16 14:16:08','2015-11-16 14:16:08','What good\'s a reward if you ain\'t around to use it? Besides, attacking that battle station ain\'t my idea of courage. It\'s more like suicide. All right. Well, take care of yourself, Han. I guess that\'s what you\'re best at, isn\'t it? Hey, Luke...may the Force be with you! What\'re you lookin\' at? I know what I\'m doing.\r\n\r\nLuke? Luke? Luke? Have you seen Luke this morning? He said he had some things to do before he started today, so he left early. Uh? Did he take those two new droids with him? I think so. Well, he\'d better have those units in the south range repaired be midday or there\'ll be hell to pay! Wait, there\'s something dead ahead on the scanner. It looks like our droid...hit the accelerator.\r\n\r\nThere she is. See-Threepio, do you copy? For the moment. Uh, we\'re in the main hangar across from the ship. We\'re right above you. Stand by. You came in that thing? You\'re braver that I thought. Nice! Come on! It\'s them! Blast them! Get back to the ship! Where are you going? Come back! He certainly has courage. What good will it do us if he gets himself killed? Come on! I think we took a wrong turn. There\'s no lock! That oughta hold it for a while. Quick, we\'ve got to get across. Find the control that extends the bridge. Oh, I think I just blasted it. They\'re coming through! Here, hold this. Here they come! For luck!\r\n\r\nDon\'t be too proud of this technological terror you\'ve constructed. The ability to destroy a planet is insignificant next to the power of the Force. Don\'t try to frighten us with your sorcerer\'s ways, Lord Vader. Your sad devotion to that ancient religion has not helped you conjure up the stolen data tapes, or given you clairvoyance enough to find the Rebel\'s hidden fort... I find your lack of faith disturbing. Enough of this! Vader, release him! As you wish. This bickering is pointless. Lord Vader will provide us with the location of the Rebel fortress by the time this station is operational. We will then crush the Rebellion with one swift stroke.\r\n\r\nHello there! Come here my little friend. Don\'t be afraid. Don\'t worry, he\'ll be all right. What happened? Rest easy, son, you\'ve had a busy day. You\'re fortunate you\'re still in one piece. Ben? Ben Kenobi! Boy, am I glad to see you! The Jundland wastes are not to be traveled lightly. Tell me young Luke, what brings you out this far? Oh, this little droid! I think he\'s searching for his former master...I\'ve never seen such devotion in a droid before...there seems to be no stopping him. He claims to be the property of an Obi-Wan Kenobi. Is he a relative of yours? Do you know who he\'s talking about?','Tal-Rex does it&nbsp;again','','trash','closed','open','','tal-rex-does-it-again','','','2016-02-18 15:56:34','2016-02-18 15:56:34','',0,'http://local.wordpress.dev/?p=437',0,'post','',0),(439,3,'2015-11-16 14:16:08','2015-11-16 14:16:08','','Tal-Rex does it again','','inherit','closed','closed','','437-revision-v1','','','2015-11-16 14:16:08','2015-11-16 14:16:08','',437,'http://local.wordpress.dev/437-revision-v1/',0,'revision','',0),(440,3,'2015-11-16 14:33:51','2015-11-16 14:33:51','','Tal-Rex does it&nbsp;again','','inherit','closed',