s will be on hand, so no experience is required.\r\n<h2>What you\'ll need</h2>\r\n<ul>\r\n<ul>\r\n	<li>Football boots</li>\r\n	<li>Appropriate athletic clothing</li>\r\n	<li>Water</li>\r\n</ul>\r\n</ul>\r\n<h2>Fees</h2>\r\nWhilst settling into the roost, enjoy the first month of training for free.','Join us','','publish','closed','closed','','join-us','','','2016-02-20 01:17:09','2016-02-20 01:17:09','',0,'http://local.wordpress.dev/?page_id=571',0,'page','',0),(572,3,'2015-11-20 22:44:51','2015-11-20 22:44:51','If you fancy having a go, we\'d love to have you. Just come down to any training session, even if you just want to watch to start with.\r\n\r\n<h2>What you\'ll need</h2>\r\nFootball boots (or even better, American Football Cleats, if you have them) suitable for good traction on grass.\r\n\r\n<h2>Fees</h2>\r\nFirst month is free.','Join us','','inherit','closed','closed','','571-revision-v1','','','2015-11-20 22:44:51','2015-11-20 22:44:51','',571,'http://local.wordpress.dev/571-revision-v1/',0,'revision','',0),(573,3,'2015-11-20 22:46:35','2015-11-20 22:46:35','The Manchester Crows are Manchester\'s premier flag football team. We play a version of 5-a-side American Football without pads or helmets, where tackles are made by pulling a flag from the ball carrier\'s belt.\r\n\r\n<a class=\"button\" href=\"/flag-american-football/\">More about Flag Football</a>\r\n\r\n<a class=\"button\" href=\"/join-us/\">Join us</a>','Flag American Football','','inherit','closed','closed','','2-revision-v1','','','2015-11-20 22:46:35','2015-11-20 22:46:35','',2,'http://local.wordpress.dev/2-revision-v1/',0,'revision','',0),(574,3,'2015-11-20 22:50:05','2015-11-20 22:50:05','The Manchester Crows are Manchester\'s premier flag football team. We play a version of 5-a-side American Football without pads or helmets, where tackles are made by pulling a flag from the ball carrier\'s belt.\r\n\r\n<div class=\"intro__buttons\">\r\n<a class=\"button button--light\" href=\"/flag-american-football/\">More about Flag Football</a>\r\n<a class=\"button button--light\" href=\"/join-us/\">Join us</a>\r\n</div>','Flag American Football','','inherit','closed','closed','','2-revision-v1','','','2015-11-20 22:50:05','2015-11-20 22:50:05','',2,'http://local.wordpress.dev/2-revision-v1/',0,'revision','',0),(575,3,'2015-11-20 23:07:28','2015-11-20 23:07:28','','Cheshire Cavaliers','','publish','closed','closed','','cheshire-cavaliers','','','2015-11-20 23:07:28','2015-11-20 23:07:28','',0,'http://local.wordpress.dev/?post_type=fixture&#038;p=575',0,'fixture','',0),(576,3,'2015-11-20 23:07:28','2015-11-20 23:07:28','','Cheshire Cavaliers','','inherit','closed','closed','','575-revision-v1','','','2015-11-20 23:07:28','2015-11-20 23:07:28','',575,'http://local.wordpress.dev/575-revision-v1/',0,'revision','',0),(577,3,'2015-11-20 23:32:10','2015-11-20 23:32:10','','19994535974_671efd0d00_o','','inherit','closed','closed','','19994535974_671efd0d00_o','','','2015-11-20 23:32:10','2015-11-20 23:32:10','',10,'http://local.wordpress.dev/wp-content/uploads/2015/10/19994535974_671efd0d00_o.jpg',0,'attachment','image/jpeg',0),(578,3,'2015-11-20 23:32:20','2015-11-20 23:32:20','','The Team','','inherit','closed','closed','','10-revision-v1','','','2015-11-20 23:32:20','2015-11-20 23:32:20','',10,'http://local.wordpress.dev/10-revision-v1/',0,'revision','',0),(579,3,'2015-11-20 23:32:56','2015-11-20 23:32:56','','The Team','','inherit','closed','closed','','10-revision-v1','','','2015-11-20 23:32:56','2015-11-20 23:32:56','',10,'http://local.wordpress.dev/10-revision-v1/',0,'revision','',0),(580,3,'2015-11-21 01:02:15','2015-11-21 01:02:15','','tal-rex','','inherit','closed','closed','','tal-rex','','','2015-11-21 01:02:30','2015-11-21 01:02:30','',437,'http://local.wordpress.dev/wp-content/uploads/2015/11/tal-rex.jpg',0,'attachment','image/jpeg',0),(581,3,'2015-11-21 01:02:32','2015-11-21 01:02:32','What good\'s a reward if you ain\'t around to use it? Besides, attacking that battle station ain\'t my idea of courage. It\'s more like suicide. All right. Well, take care of yourself, Han. I guess that\'s what you\'re best at, isn\'t it? Hey, Luke...may the Force be with you! What\'re you lookin\' at? I know what I\'m doing.\r\n\r\nLuke? Luke? Luke? Have you seen Luke this morning? He said he had some things to do before he started today, so he left early. Uh? Did he take those two new droids with him? I think so. Well, he\'d better have those units in the south range repaired be midday or there\'ll be hell to pay! Wait, there\'s something dead ahead on the scanner. It looks like our droid...hit the accelerator.\r\n\r\nThere she is. See-Threepio, do you copy? For the moment. Uh, we\'re in the main hangar across from the ship. We\'re right above you. Stand by. You came in that thing? You\'re braver that I thought. Nice! Come on! It\'s them! Blast them! Get back to the ship! Where are you going? Come back! He certainly has courage. What good will it do us if he gets himself killed? Come on! I think we took a wrong turn. There\'s no lock! That oughta hold it for a while. Quick, we\'ve got to get across. Find the control that extends the bridge. Oh, I think I just blasted it. They\'re coming through! Here, hold this. Here they come! For luck!\r\n\r\nDon\'t be too proud of this technological terror you\'ve constructed. The ability to destroy a planet is insignificant next to the power of the Force. Don\'t try to frighten us with your sorcerer\'s ways, Lord Vader. Your sad devotion to that ancient religion has not helped you conjure up the stolen data tapes, or given you clairvoyance enough to find the Rebel\'s hidden fort... I find your lack of faith disturbing. Enough of this! Vader, release him! As you wish. This bickering is pointless. Lord Vader will provide us with the location of the Rebel fortress by the time this station is operational. We will then crush the Rebellion with one swift stroke.\r\n\r\nHello there! Come here my little friend. Don\'t be afraid. Don\'t worry, he\'ll be all right. What happened? Rest easy, son, you\'ve had a busy day. You\'re fortunate you\'re still in one piece. Ben? Ben Kenobi! Boy, am I glad to see you! The Jundland wastes are not to be traveled lightly. Tell me young Luke, what brings you out this far? Oh, this little droid! I think he\'s searching for his former master...I\'ve never seen such devotion in a droid before...there seems to be no stopping him. He claims to be the property of an Obi-Wan Kenobi. Is he a relative of yours? Do you know who he\'s talking about?','Tal-Rex does it&nbsp;again','','inherit','closed','closed','','437-revision-v1','','','2015-11-21 01:02:32','2015-11-21 01:02:32','',437,'http://local.wordpress.dev/437-revision-v1/',0,'revision','',0),(583,3,'2016-01-10 20:11:46','2016-01-10 20:11:46','','Super Crowl','','publish','closed','closed','','super-crowl','','','2016-02-18 20:24:29','2016-02-18 20:24:29','',0,'http://local.wordpress.dev/?post_type=fixture&#038;p=583',0,'fixture','',0),(584,3,'2016-01-10 20:11:46','2016-01-10 20:11:46','','Super-Crowl','','inherit','closed','closed','','583-revision-v1','','','2016-01-10 20:11:46','2016-01-10 20:11:46','',583,'http://local.wordpress.dev/583-revision-v1/',0,'revision','',0),(585,3,'2016-01-10 20:15:12','2016-01-10 20:15:12','','Super-Crowl','','inherit','closed','closed','','583-revision-v1','','','2016-01-10 20:15:12','2016-01-10 20:15:12','',583,'http://local.wordpress.dev/583-revision-v1/',0,'revision','',0),(586,3,'2016-01-10 20:20:13','2016-01-10 20:20:13','','Super Crowl','','inherit','closed','closed','','583-revision-v1','','','2016-01-10 20:20:13','2016-01-10 20:20:13','',583,'http://local.wordpress.dev/583-revision-v1/',0,'revision','',0),(587,3,'2016-01-10 20:33:13','2016-01-10 20:33:13','','Super Crowl','','inherit','closed','closed','','583-revision-v1','','','2016-01-10 20:33:13','2016-01-10 20:33:13','',583,'http://local.wordpress.dev/583-revision-v1/',0,'revision','',0),(5