ities','changing_facilities','publish','closed','closed','','field_56b106bf2bd7e','','','2016-02-02 19:30:42','2016-02-02 19:30:42','',210,'http://local.wordpress.dev/?post_type=acf-field&p=636',9,'acf-field','',0),(637,3,'2016-02-02 19:31:42','2016-02-02 19:31:42','','Super Crowl','','inherit','closed','closed','','583-revision-v1','','','2016-02-02 19:31:42','2016-02-02 19:31:42','',583,'http://local.wordpress.dev/583-revision-v1/',0,'revision','',0),(639,3,'2016-02-13 15:55:01','2016-02-13 15:55:01','The Manchester Crows are Manchester\'s premier flag football team. We play a version of 5-a-side American Football without pads or helmets, where tackles are made by pulling a flag from the ball carrier\'s belt.\r\n\r\n<div class=\"intro__buttons\">\r\n<a class=\"button\" href=\"/flag-american-football/\">More about Flag Football</a>\r\n<a class=\"button\" href=\"/join-us/\">Join us</a>\r\n</div>','Flag American Football','','inherit','closed','closed','','2-revision-v1','','','2016-02-13 15:55:01','2016-02-13 15:55:01','',2,'http://local.wordpress.dev/2-revision-v1/',0,'revision','',0),(640,3,'2016-02-13 15:58:05','2016-02-13 15:58:05','Flag Football is the non-contact, 5-a-side version of American Football, played without pads.  A player is tackled when a defender pulls a flag from their belt – with other rules closely mimicking that of the contact game.  The offense have four attempts (downs) to reach midfield, and then another four attempts (downs) to score points (touchdown) – it is the defence’s job to stop them.\r\n\r\nFlag Football is the fastest growing iteration of American Football in the United Kingdom, with over 40 teams currently playing in the national British American Football Association (BAFA) Flag League.\r\n\r\nThe Manchester Crows, founded in 2015, play in the MEC (Mid-England Conference) South Division, and are currently the region’s most successful team.','Flag Football','','inherit','closed','closed','','478-revision-v1','','','2016-02-13 15:58:05','2016-02-13 15:58:05','',478,'http://local.wordpress.dev/478-revision-v1/',0,'revision','',0),(641,3,'2016-02-13 15:59:11','2016-02-13 15:59:11','Unlike a lot of birds, Crows do not migrate when temperatures drop, which means that the Manchester Crows are on the lookout for new players all year round!  If learning about the sport of American Football and playing in a safe, friendly and welcoming environment appeals to you, then come down to any of our training sessions.  Absolutely no experience needed.\n\n<h2>What you\'ll need</h2>\n\nFootball boots (studs are better than blades)\nAppropriate athletic clothing\nWater  \n\n<h2>Fees</h2>\nFirst month is free.','Join us','','inherit','closed','closed','','571-autosave-v1','','','2016-02-13 15:59:11','2016-02-13 15:59:11','',571,'http://local.wordpress.dev/571-autosave-v1/',0,'revision','',0),(642,3,'2016-02-13 15:59:47','2016-02-13 15:59:47','Unlike a lot of birds, Crows do not migrate when temperatures drop, which means that the Manchester Crows are on the lookout for new players all year round!  If learning about the sport of American Football and playing in a safe, friendly and welcoming environment appeals to you, then come down to any of our training sessions.  Absolutely no experience needed.\r\n\r\n<h2>What you\'ll need</h2>\r\n<ul>\r\n<li>Football boots (studs are better than blades)</li>\r\n<li>Appropriate athletic clothing</li>\r\n<li>Water</li>\r\n\r\n<h2>Fees</h2>\r\nWhilst you settle into our roost, enjoy your first month of training for free!','Join us','','inherit','closed','closed','','571-revision-v1','','','2016-02-13 15:59:47','2016-02-13 15:59:47','',571,'http://local.wordpress.dev/571-revision-v1/',0,'revision','',0),(643,3,'2016-02-13 16:09:26','2016-02-13 16:09:26','','Super Crowl','','inherit','closed','closed','','583-revision-v1','','','2016-02-13 16:09:26','2016-02-13 16:09:26','',583,'http://local.wordpress.dev/583-revision-v1/',0,'revision','',0),(644,3,'2016-02-13 16:11:31','2016-02