local.wordpress.dev/571-revision-v1/',0,'revision','',0),(689,5,'2016-02-18 13:03:03','2016-02-18 13:03:03','The Manchester Crows have strong ties to the community hardwired into our DNA, having been born from the cessation of our partnership with the Manchester Titans and the now retired Manchester Mayhem. The Crows rose from the ashes of these clubs in early 2015 to forge a new identity, and have since become the North West’s most successful and popular Flag Football team – facts that I am both immensely proud of and acutely aware of. As General Manager of the team it is my job to ensure we retain this upward trajectory, whilst staying true to our core principles of teamwork, sportsmanship, self-discipline, and above all, fun. The Crows began in their earliest iteration with four players; it has been the love and support of the community and the players that have gotten us to the point we are at today – the most handsome and winningest team in the North West.\r\n\r\nThere is no time quite like the present to join the #CrowNation. The sport of Flag Football is growing at a tremendous rate across the UK, spanning all age groups and experience levels. The sport is a great introduction to American Football for those who have never played before, and is the perfect way to continue a playing career on a less physically tasking platform. Flag Football retains the spirit, strategy, and core principles of the contact game, but limits the amount of Monday mornings you have to take off from work/school.  The Crows have been at the forefront of the sport\'s emergence, acting as ambassadors for the league and developing the wider sporting community across the county.\r\n\r\nWe are lucky to have a large and diverse group of players already on our roster, men and women who flourish with the opportunity to play sport in a fun and welcoming environment.  Head over to our <a href=\"/join-us/\">Join Us</a> page for details on how you can become a member of the <a href=\"https://twitter.com/hashtag/CrowNation\">#CrowNation</a>, and remember that there is truly something that <em>everyone</em>; men/women/girls/boys/golden retrievers with a history of playing professional football/basketball/baseball, can enjoy.\r\n\r\nThank you for visiting the site – stick around and once something tickles your fancy, get in touch. Use any of the social media avenues listed below or email the team <a href=\"mailto:manchester@crowsfootball.com\">here</a>, and the management team will get back to you within a few hours.\r\n\r\nI hope to see you in the huddle soon.','A letter from our GM','','publish','closed','open','','a-letter-from-our-gm','','','2016-02-25 20:09:56','2016-02-25 20:09:56','',0,'http://local.wordpress.dev/?p=689',0,'post','',0),(691,3,'2016-02-18 11:07:17','2016-02-18 11:07:17','','image','','inherit','closed','closed','','image','','','2016-02-18 11:07:17','2016-02-18 11:07:17','',689,'http://local.wordpress.dev/wp-content/uploads/2016/02/image.jpeg',0,'attachment','image/jpeg',0),(693,3,'2016-02-18 11:08:55','2016-02-18 11:08:55','The Manchester Crows have strong ties to the Manchester community hardwired into our DNA, having originally been bred from the Manchester Titans and the now retired Manchester Mayhem.  The Crows rose from the ashes of these clubs in early 2015 to forge a new identity, and have since become the North West’s most successful and popular Flag Football team – facts that I am both immensely proud of and acutely aware of.  As General Manager of the team it is my job to ensure we retain this upward trajectory, whilst staying true to our core principles of teamwork, sportsmanship, self-discipline, and above all, fun.  The Crows began in their earliest iteration with four players; it has been the love and support of the community and the players that have gotten us to the point we are at today – the most handsome and winningest team in the North West.\r\n \r\nThere is no time quite like the present to join the #CrowNation.  Th