eryone</em>; men/women/girls/boys/golden retrievers with a history of playing professional football/basketball/baseball, can enjoy.\r\n\r\nThank you for visiting the site – stick around and once something tickles your fancy, get in touch. Use any of the social media avenues listed below or email the team <span style=\"text-decoration: underline;\">here</span>, and the management team will get back to you within a few hours.\r\n\r\nI hope to see you in the huddle soon.','A letter from our GM','','inherit','closed','closed','','689-revision-v1','','','2016-02-18 23:09:59','2016-02-18 23:09:59','',689,'http://local.wordpress.dev/689-revision-v1/',0,'revision','',0),(749,5,'2016-02-18 23:11:37','2016-02-18 23:11:37','The Manchester Crows have strong ties to the community hardwired into our DNA, having been born from the cessation of our partnership with the Manchester Titans and the now retired Manchester Mayhem. The Crows rose from the ashes of these clubs in early 2015 to forge a new identity, and have since become the North West’s most successful and popular Flag Football team – facts that I am both immensely proud of and acutely aware of. As General Manager of the team it is my job to ensure we retain this upward trajectory, whilst staying true to our core principles of teamwork, sportsmanship, self-discipline, and above all, fun. The Crows began in their earliest iteration with four players; it has been the love and support of the community and the players that have gotten us to the point we are at today – the most handsome and winningest team in the North West.\r\n\r\nThere is no time quite like the present to join the #CrowNation. The sport of Flag Football is growing at a tremendous rate across the UK, spanning all age groups and experience levels. The sport is a great introduction to American Football for those who have never played before, and is the perfect way to continue a playing career on a less physically tasking platform. Flag Football retains the spiri