25:58','2016-02-20 00:25:58','The Manchester Crows have strong ties to the community hardwired into our DNA, having been born from the cessation of our partnership with the Manchester Titans and the now retired Manchester Mayhem. The Crows rose from the ashes of these clubs in early 2015 to forge a new identity, and have since become the North West’s most successful and popular Flag Football team – facts that I am both immensely proud of and acutely aware of. As General Manager of the team it is my job to ensure we retain this upward trajectory, whilst staying true to our core principles of teamwork, sportsmanship, self-discipline, and above all, fun. The Crows began in their earliest iteration with four players; it has been the love and support of the community and the players that have gotten us to the point we are at today – the most handsome and winningest team in the North West.\r\n\r\nThere is no time quite like the present to join the #CrowNation. The sport of Flag Football is growing at a tremendous rate across the UK, spanning all age groups and experience levels. The sport is a great introduction to American Football for those who have never played before, and is the perfect way to continue a playing career on a less physically tasking platform. Flag Football retains the spirit, strategy, and core principles of the contact game, but limits the amount of Monday mornings you have to take off from work/school.  The Crows have been at the forefront of the sport\'s emergence, acting as ambassadors for the league and developing the wider sporting community across the county.\r\n\r\nWe are lucky to have a large and diverse group of players already on our roster, men and women who flourish with the opportunity to play sport in a fun and welcoming environment.  Head over to our <span style=\"text-decoration: underline;\"><a href=\"http://local.wordpress.dev/join-us/\" target=\"_blank\">Join Us</a></span> page for details on how you can become a member of the #CrowNation, and remember that there is truly something that <em>everyone</em>; men/women/girls/boys/golden retrievers with a history of playing professional football/basketball/baseball, can enjoy.\r\n\r\nThank you for visiting the site – stick around and once something tickles your fancy, get in touch. Use any of the social media avenues listed below or email the team <span style=\"text-decoration: underline;\">here</span>, and the management team will get back to you within a few hours.\r\n\r\nI hope to see you in the huddle soon.','A letter from our GM','','inherit','closed','closed','','689-revision-v1','','','2016-02-20 00:25:58','2016-02-20 00:25:58','',689,'http://local.wordpress.dev/689-revision-v1/',0,'revision','',0),(790,3,'2016-02-20 01:05:22','2016-02-20 01:05:22','a:7:{s:8:\"location\";a:1:{i:0;a:2:{i:0;a:3:{s:5:\"param\";s:9:\"post_type\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:4:\"page\";}i:1;a:3:{s:5:\"param\";s:13:\"page_template\";s:8:\"operator\";s:2:\"!=\";s:5:\"value\";s:14:\"page-front.php\";}}}s:8:\"position\";s:15:\"acf_after_title\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";s:0:\"\";s:11:\"description\";s:0:\"\";}','Page','page','publish','closed','closed','','group_56c7bbc052ece','','','2016-02-20 01:05:56','2016-02-20 01:05:56','',0,'http://local.wordpress.dev/?post_type=acf-field-group&#038;p=790',0,'acf-field-group','',0),(791,3,'2016-02-20 01:05:22','2016-02-20 01:05:22','a:15:{s:4:\"type\";s:5:\"image\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:1;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"return_format\";s:5:\"array\";s:12:\"preview_size\";s:9:\"thumbnail\";s:7:\"library\";s:3:\"all\";s:9:\"min_width\";s:0:\"\";s:10:\"min_height\";s:0:\"\";s:8:\"min_size\";s:0:\"\";s:9:\"max_width\";s:0:\"\";s:10:\"max_height\";s:0:\"\";s:8:\"max_size\";s:0:\"\";s:10:\"mime_types\";s:0:\"\";}','Image','image','publish','closed','closed','','field_56c7bbc66a363','','','2016-02-20 01:05:22','2016-02-20 01:05:22','',790,'http://local.wordpress.dev/?post_type=acf-field&p=791',0,'acf-field','',0),(792,3,'2016-02-20 01:07:18','2016-02-20 01:07:18','Flag Football is the non-contact, 5-a-side version of American Football, played without pads.  A player is tackled when a defender pulls a flag from their belt – with other rules closely mimicking that of the contact game.  The offense have four attempts (downs) to reach midfield, and then another four attempts (downs) to score points (touchdown) – it is the defence’s job to stop them.\r\n\r\nFlag Football is the fastest growing iteration of American Football in the United Kingdom, with over 40 teams currently playing in the national British American Football Association (BAFA) Flag League.\r\n\r\nThe Manchester Crows, founded in 2015, play in the MEC (Mid-England Conference) South Division, and are currently the region’s most successful team.','Flag Football','','inherit','closed','closed','','478-revision-v1','','','2016-02-20 01:07:18','2016-02-20 01:07:18','',478,'http://local.wordpress.dev/478-revision-v1/',0,'revision','',0),(793,3,'2016-02-20 01:17:09','2016-02-20 01:17:09','As Crows do not migrate when temperatures drop, the Manchester Crows are on the lookout for new players all year round.  If learning about the sport of American Football and playing in a safe, friendly and welcoming environment appeals to you, then come down to any Manchester Crows training session.  Experienced coaches will be on hand, so no experience is required.\r\n<h2>What you\'ll need</h2>\r\n<ul>\r\n<ul>\r\n	<li>Football boots</li>\r\n	<li>Appropriate athletic clothing</li>\r\n	<li>Water</li>\r\n</ul>\r\n</ul>\r\n<h2>Fees</h2>\r\nWhilst settling into the roost, enjoy the first month of training for free.','Join us','','inherit','closed','closed','','571-revision-v1','','','2016-02-20 01:17:09','2016-02-20 01:17:09','',571,'http://local.wordpress.dev/571-revision-v1/',0,'revision','',0),(794,3,'2016-02-20 01:31:16','2016-02-20 01:31:16','','The Team','','inherit','closed','closed','','10-revision-v1','','','2016-02-20 01:31:16','2016-02-20 01:31:16','',10,'http://local.wordpress.dev/10-revision-v1/',0,'revision','',0),(795,3,'2016-02-20 02:01:35','2016-02-20 02:01:35','The Manchester Crows have strong ties to the community hardwired into our DNA, having been born from the cessation of our partnership with the Manchester Titans and the now retired Manchester Mayhem. The Crows rose from the ashes of these clubs in early 2015 to forge a new identity, and have since become the North West’s most successful and popular Flag Football team – facts that I am both immensely proud of and acutely aware of. As General Manager of the team it is my job to ensure we retain this upward trajectory, whilst staying true to our core principles of teamwork, sportsmanship, self-discipline, and above all, fun. The Crows began in their earliest iteration with four players; it has been the love and support of the community and the players that have gotten us to the point we are at today – the most handsome and winningest team in the North West.\n\nThere is no time quite like the present to join the #CrowNation. The sport of Flag Football is growing at a tremendous rate across the UK, spanning all age groups and experience levels. The sport is a great introduction to American Football for those who have never played before, and is the perfect way to continue a playing career on a less physically tasking platform. Flag Football retains the spirit, strategy, and core principles of the contact game, but limits the amount of Monday mornings you have to take off from work/school.  The Crows have been at the forefront of the sport\'s emergence, acting as ambassadors for the league and developing the wider sporting community across the county.\n\nWe are lucky to have a large and diverse group of players already on our roster, men and women who flourish with the opportunity to play sport in a fun and welcoming environment.  Head over to our <a href=\"/join-us/\">Join Us</a> page for details on how you can become a member of the #CrowNation, and remember that there is truly something that <em>everyone</em>; men/women/girls/boys/golden retrievers with a history of playing professional football/basketball/baseball, can enjoy.\n\nThank you for visiting the site – stick around and once something tickles your fancy, get in touch. Use any of the social media avenues listed below or email the team <a href=\"mailto:manchester@crowsfootball.com\">here</a>, and the management team will get back to you within a few hours.\n\nI hope to see you in the huddle soon.','A letter from our GM','','inherit','closed','closed','','689-autosave-v1','','','2016-02-20 02:01:35','2016-02-20 02:01:35','',689,'http://local.wordpress.dev/689-autosave-v1/',0,'revision','',0),(796,3,'2016-02-20 02:01:44','2016-02-20 02:01:44','The Manchester Crows have strong ties to the community hardwired into our DNA, having been born from the cessation of our partnership with the Manchester Titans and the now retired Manchester Mayhem. The Crows rose from the ashes of these clubs in early 2015 to forge a new identity, and have since become the North West’s most successful and popular Flag Football team – facts that I am both immensely proud of and acutely aware of. As General Manager of the team it is my job to ensure we retain this upward trajectory, whilst staying true to our core principles of teamwork, sportsmanship, self-discipline, and above all, fun. The Crows began in their earliest iteration with four players; it has been the love and support of the community and the players that have gotten us to the point we are at today – the most handsome and winningest team in the North West.\r\n\r\nThere is no time quite like the present to join the #CrowNation. The sport of Flag Football is growing at a tremendous rate across the UK, spanning all age groups and experience levels. The sport is a great introduction to American Football for those who have never played before, and is the perfect way to continue a playing career on a less physically tasking platform. Flag Football retains the spirit, strategy, and core principles of the contact game, but limits the amount of Monday mornings you have to take off from work/school.  The Crows have been at the forefront of the sport\'s emergence, acting as ambassadors for the league and developing the wider sporting community across the county.\r\n\r\nWe are lucky to have a large and diverse group of players already on our roster, men and women who flourish with the opportunity to play sport in a fun and welcoming environment.  Head over to our <a href=\"/join-us/\">Join Us</a> page for details on how you can become a member of the <a href=\"https://twitter.com/hashtag/CrowNation\">#CrowNation</a>, and remember that there is truly something that <em>everyone</em>; men/women/girls/boys/golden retrievers with a history of playing professional football/basketball/baseball, can enjoy.\r\n\r\nThank you for visiting the site – stick around and once something tickles your fancy, get in touch. Use any of the social media avenues listed below or email the team <a href=\"mailto:manchester@crowsfootball.com\">here</a>, and the management team will get back to you within a few hours.\r\n\r\nI hope to see you in the huddle soon.','A letter from our GM','','inherit','closed','closed','','689-revision-v1','','','2016-02-20 02:01:44','2016-02-20 02:01:44','',689,'http://local.wordpress.dev/689-revision-v1/',0,'revision','',0),(797,3,'2016-02-20 20:58:41','2016-02-20 20:58:41','Nick Bertenshaw of <abbr title=\"British American Football Association\" class=\"accronym\">BAFA</abbr> released to teams the official divisional separation for the 2016 BAFA Flag league, set to kick off the week of the 4th of April.\r\n\r\nNew comers \"Doncaster Mustangs\" are already causing controversy by claiming the team doesn\'t even exist, so we\'ll be watching that with interest. We don\'t want a repeat of 2014\'s debacle where one of our most convincing wins over the Sheffield Vipers ended up being stricken from the record [along with all player stats from that game… grumble - Ed.].\r\n\r\nMore information can be found over on <a href=\"http://pullingtheflag.co.uk/2016/02/bafa-flag-2016-the-divisions.html\">Pulling the Flag</a>.','2016 BAFA Divisions','','publish','closed','open','','2016-league-divisions-announced','','','2016-02-20 21:42:53','2016-02-20 21:42:53','',0,'http://local.wordpress.dev/?p=797',0,'post','',0),(798,3,'2016-02-20 20:52:14','2016-02-20 20:52:14','','Crows & Cavaliers','','inherit','closed','closed','','24867548415_7bb3bbebf6_o','','','2016-02-20 20:52:27','2016-02-20 20:52:27','',797,'http://local.wordpress.dev/wp-content/uploads/2016/02/24867548415_7bb3bbebf6_o.jpg',0,'attachment','image/jpeg',0),(799,3,'2016-02-20 20:58:41','2016-02-20 20:58:41','Nick Bertenshaw of <abbr title=\"British American Football Association\" class=\"accronym\">BAFA</abbr> released to teams the official divisional separation for the 2016 BAFA Flag league, set to kick off the week of the 4th of April.\r\n\r\nNew comers \"Doncaster Mustangs\" are already causing controversy by claiming the team doesn\'t even exist, so we\'ll be watching that with interest. We don\'t want a repeat of 2014\'s debacle where one of our most convincing wins over the Sheffield Vipers ended up being stricken from the record [along with all player stats from that game… grumble - Ed.].\r\n\r\nMore information can be found over on <a href=\"http://pullingtheflag.co.uk/2016/02/bafa-flag-2016-the-divisions.html\">Pulling the Flag</a>.','2016 League Divisions announced','','inherit','closed','closed','','797-revision-v1','','','2016-02-20 20:58:41','2016-02-20 20:58:41','',797,'http://local.wordpress.dev/797-revision-v1/',0,'revision','',0),(800,3,'2016-0